import React, { useState } from 'react';
import AuthForm from './AuthForm.js';

function Register() {
const [ data, setData ] = useState({
  email: '',
  password: '',
  message: ''
});

function handleChange(e) {
  const { name, value } = e.target;
  setData({
    ...data,
    [name]: value
  })
}

function handleSubmit(e) {

}


  return (
    <AuthForm 
      title={'Регистрация'}
      text={'Зарегистрироваться'}
      active={'auth__text_active'}
      children={
        <>
          <label>
            <input type="email" defaultValue="" className="auth__item auth__item_type_email" name="email" placeholder="Email" required minLength="2" maxLength="40" />
            <span id="email-error" className="auth__item-error"></span>
          </label>
          <label>
            <input type="password" defaultValue="" className="auth__item auth__item_type_password" name="password" placeholder="Пароль" required minLength="2" maxLength="200" />
            <span id="password-error" className="auth__item-error"></span>
          </label>
        </>
      }
      onSubmit={handleSubmit}
    />
  );
}

export default Register;
